import React, {Component} from "react";

class Contact extends Component {

    state = {
        contacts : [
            {num : '+216 1684984'}
        ]
    }

    render (){
        return (
            <div>
              <h1>Contacts</h1>
            </div>
        );
    }
}

export default Contact;
